    /**
     * Gets the attribute value for the calculated attribute TransAbsoluteError.
     * @return the TransAbsoluteError
     */
    public BigDecimal getTransAbsoluteError() {
        BigDecimal absError = null;
        try {
            if (getItem() != null && getCandyNetFinalAmount() != null &&
                getTransNetFinalAmount() != null) {
                Double candyNetAmt = getCandyNetFinalAmount().doubleValue();
                Double fussNetAmtDbl = getTransNetFinalAmount().doubleValue();

                if (candyNetAmt != null && fussNetAmtDbl != null) {
                    absError = new BigDecimal(candyNetAmt - fussNetAmtDbl);
                }
            }
        } catch (Exception e) {
            return null;
        }
        return absError;
    }

